import React, { useState } from 'react';
import './css/VisionBoard.css';
import { ReactComponent as VisionBoardHeadline } from './images/vision-board-headline.svg';

const VisionBoard = () => {
  const [imageErrors, setImageErrors] = useState(new Set());

  // Sample images - you can replace these with your actual image URLs
  const images = [
    { id: 1, src: 'https://picsum.photos/200/300?random=1', alt: 'Vision 1' },
    { id: 2, src: 'https://picsum.photos/200/400?random=2', alt: 'Vision 2' },
    { id: 3, src: 'https://picsum.photos/200/250?random=3', alt: 'Vision 3' },
    { id: 4, src: 'https://picsum.photos/200/350?random=4', alt: 'Vision 4' },
    { id: 5, src: 'https://picsum.photos/200/280?random=5', alt: 'Vision 5' },
    { id: 6, src: 'https://picsum.photos/200/420?random=6', alt: 'Vision 6' },
    { id: 7, src: 'https://picsum.photos/200/320?random=7', alt: 'Vision 7' },
    { id: 8, src: 'https://picsum.photos/200/260?random=8', alt: 'Vision 8' },
    { id: 9, src: 'https://picsum.photos/200/380?random=9', alt: 'Vision 9' },
    { id: 10, src: 'https://picsum.photos/200/300?random=10', alt: 'Vision 10' },
    { id: 11, src: 'https://picsum.photos/200/340?random=11', alt: 'Vision 11' },
    { id: 12, src: 'https://picsum.photos/200/290?random=12', alt: 'Vision 12' },
    { id: 13, src: 'https://picsum.photos/200/410?random=13', alt: 'Vision 13' },
    { id: 14, src: 'https://picsum.photos/200/270?random=14', alt: 'Vision 14' },
    { id: 15, src: 'https://picsum.photos/200/360?random=15', alt: 'Vision 15' },
    { id: 16, src: 'https://picsum.photos/200/230?random=16', alt: 'Vision 16' },
    { id: 17, src: 'https://picsum.photos/200/390?random=17', alt: 'Vision 17' },
    { id: 18, src: 'https://picsum.photos/200/310?random=18', alt: 'Vision 18' },
    { id: 19, src: 'https://picsum.photos/200/250?random=19', alt: 'Vision 19' },
    { id: 20, src: 'https://picsum.photos/200/370?random=20', alt: 'Vision 20' },
    { id: 21, src: 'https://picsum.photos/200/290?random=21', alt: 'Vision 21' },
    { id: 22, src: 'https://picsum.photos/200/330?random=22', alt: 'Vision 22' },
    { id: 23, src: 'https://picsum.photos/200/280?random=23', alt: 'Vision 23' },
    { id: 24, src: 'https://picsum.photos/200/400?random=24', alt: 'Vision 24' },
    { id: 25, src: 'https://picsum.photos/200/260?random=25', alt: 'Vision 25' },
    { id: 26, src: 'https://picsum.photos/200/340?random=26', alt: 'Vision 26' },
    { id: 27, src: 'https://picsum.photos/200/320?random=27', alt: 'Vision 27' },
    { id: 28, src: 'https://picsum.photos/200/300?random=28', alt: 'Vision 28' },
    { id: 29, src: 'https://picsum.photos/200/380?random=29', alt: 'Vision 29' },
    { id: 30, src: 'https://picsum.photos/200/250?random=30', alt: 'Vision 30' },
    { id: 31, src: 'https://picsum.photos/200/350?random=31', alt: 'Vision 31' },
    { id: 32, src: 'https://picsum.photos/200/290?random=32', alt: 'Vision 32' },
    { id: 33, src: 'https://picsum.photos/200/270?random=33', alt: 'Vision 33' },
    { id: 34, src: 'https://picsum.photos/200/410?random=34', alt: 'Vision 34' },
    { id: 35, src: 'https://picsum.photos/200/230?random=35', alt: 'Vision 35' },
    { id: 36, src: 'https://picsum.photos/200/360?random=36', alt: 'Vision 36' },
    { id: 37, src: 'https://picsum.photos/200/320?random=37', alt: 'Vision 37' },
    { id: 38, src: 'https://picsum.photos/200/280?random=38', alt: 'Vision 38' },
    { id: 39, src: 'https://picsum.photos/200/390?random=39', alt: 'Vision 39' },
    { id: 40, src: 'https://picsum.photos/200/310?random=40', alt: 'Vision 40' },
    { id: 41, src: 'https://picsum.photos/200/240?random=41', alt: 'Vision 41' },
    { id: 42, src: 'https://picsum.photos/200/370?random=42', alt: 'Vision 42' },
    { id: 43, src: 'https://picsum.photos/200/300?random=43', alt: 'Vision 43' },
    { id: 44, src: 'https://picsum.photos/200/330?random=44', alt: 'Vision 44' },
    { id: 45, src: 'https://picsum.photos/200/260?random=45', alt: 'Vision 45' },
  ];

  const handleImageLoad = (imageId) => {
    // Image loaded successfully - could add additional logic here if needed
    console.log(`Image ${imageId} loaded successfully`);
  };

  const handleImageError = (imageId) => {
    console.warn(`Failed to load image ${imageId}`);
    setImageErrors(prev => new Set([...prev, imageId]));
  };

  const getImageSrc = (image) => {
    if (imageErrors.has(image.id)) {
      return `https://via.placeholder.com/200x300/ff69b4/ffffff?text=Vision+${image.id}`;
    }
    return image.src;
  };

  return (
    <div className="vision-board">


      <div className="break-strawberry-container">
        <VisionBoardHeadline />
      </div>

      <div className="masonry-grid">
        {images.map((image) => (
          <div key={image.id} className="masonry-item">
            <img 
              src={getImageSrc(image)}
              alt={image.alt}
              loading="lazy"
              onLoad={() => handleImageLoad(image.id)}
              onError={() => handleImageError(image.id)}
            />
            <div className="masonry-overlay">
              <span>{image.alt}</span>
            </div>
          </div>
        ))}
      </div>


      <div className="vision-board-header">
        <div className="rectangle-container">
          {Array.from({ length: 12 }, (_, index) => (
            <div key={index} className="rectangle-item">
              <span>Item {index + 1}</span>
              <div className="tooltip">Tooltip for Item {index + 1}</div>
            </div>
          ))}
        </div>
        <h1>Vision Board</h1>
        <p>A collection of inspirational images and goals</p>
      </div>
    </div>
  );
};

export default VisionBoard;
